.table-container .el-table--border th:nth-last-child(2) {
    border-right: 1px solid #d3dae0 !important;
}
.table-container .el-table--border th:nth-last-child(1) {
    border-right: none !important;
}
.app-container >>> .filter-container .el-input {
    vertical-align: top;
}
.app-container >>> .filter-container .el-input__inner {
    height: 32px;
    line-height: 32px;
}
.app-container >>> .filter-container .el-input-group {
    height: 30px;
    line-height: 30px;
}
.app-container >>> .filter-container .el-input-group__append,
.table-container >>> .dialog-custom .el-input-group__append {
    background-color: #fff;
}
.table-container >>> .el-table .el-checkbox {
    vertical-align: top;
    width: unset !important;
    margin: 0 5px !important;
    font-weight: normal;
}
.table-container >>> .el-table .el-checkbox .el-checkbox__label {
    font-size: 12px !important;
    padding-left: 5px;
}
.table-container >>> .el-table .el-checkbox .el-checkbox__inner {
    vertical-align: top;
    margin-top: -1px;
}
.table-container >>> .dialog-custom .el-form-item {
    display: inline-block !important;
    vertical-align: top;
    width: 30%;
    margin-bottom: 10px !important;
}
.table-container >>> .dialog-custom2 .el-form-item {
    display: inline-block !important;
    vertical-align: top;
    width: 24%;
    margin-bottom: 10px !important;
}
.el-checkbox {
    width: 28%;
}
.table-container >>> .dialog-custom2 .el-dialog__body,
.table-container >>> .dialog-custom .el-dialog__body {
    padding: 10px 0 0 !important;
}
.table-container >>> .dialog-custom2,
.table-container >>> .dialog-custom {
    width: 80% !important;
    max-width: 1200px;
}
.table-container >>> .el-table .el-input__inner,
.table-container >>> .el-dialog .el-input__inner {
    height: 28px;
    line-height: 28px;
}
